DROP PROCEDURE IF EXISTS `insert_items`;
delimiter ;;
CREATE DEFINER=`tech_test2`@`%` PROCEDURE `insert_items`()
BEGIN
  DECLARE i INT DEFAULT 1703;
  
  WHILE i <= 1999 DO
    SET i = i + 1;
  END WHILE;
  
END
;;
delimiter ;

-- ----------------------------
-- Function structure for SPLIT_STR
-- ----------------------------
DROP FUNCTION IF EXISTS `SPLIT_STR`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `SPLIT_STR`(x VARCHAR(255),
  delim VARCHAR(12),
  pos INT
) RETURNS varchar(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
    DETERMINISTIC
BEGIN 
    RETURN REPLACE(SUBSTRING(SUBSTRING_INDEX(x, delim, pos),
       LENGTH(SUBSTRING_INDEX(x, delim, pos - 1)) + 1),
       delim, '');
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
