INSERT INTO `radar` VALUES (837, 7476, 3, 60, 0, 34, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Lính độc nhãn', 'Người ta nuôi quân lính dùng trong 1 giờ, Lính độc nhãn thì không dùng được 5 phút', '[{\"id\": 6, \"param\": 10000, \"activeCard\": 0},\n{\"id\": 6, \"param\": 20000, \"activeCard\": 1},\n{\"id\": 6, \"param\": 30000, \"activeCard\": 2}]', -1);
INSERT INTO `radar` VALUES (838, 7477, 3, 60, 0, 35, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ lính độc nhãn', 'Người ta nuôi quân lính dùng trong 1 giờ, Lính độc nhãn thì không dùng được 5 phút', '[{\"id\":7,\"param\": 10000,\"activeCard\":0},{\"id\":7,\"param\": 20000,\"activeCard\":1},{\"id\":7,\"param\": 30000,\"activeCard\":2}]', -1);
INSERT INTO `radar` VALUES (839, 7478, 3, 60, 0, 36, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ sói xám', 'Được lính độc nhãn thuần hóa và cho giữ nhà như cún con, sở thích của chúng là được chơi trò nhặt bóng', '[{\"id\":0,\"param\":500,\"activeCard\":0},{\"id\":0,\"param\":700,\"activeCard\":1},{\"id\":0,\"param\":900,\"activeCard\":2}]', -1);
INSERT INTO `radar` VALUES (840, 7480, 4, 40, 1, 1, '[{\"head\":141, \"body\":142, \"leg\":143, \"bag\":-1}]', 'Thẻ trung úy trắng', 'Thân hình hơi béo so với tiêu chuẩn chung, luôn đeo chiếc khăn quàng đỏ, thường hay mơ mộng làm thơ', '[{\"id\": 94, \"param\": 5, \"activeCard\": 0},\r\n{\"id\": 77, \"param\": 5, \"activeCard\": 1},\r\n{\"id\": 103, \"param\": 5, \"activeCard\": 2}]', -1);
INSERT INTO `radar` VALUES (841, 7481, 4, 40, 1, 1, '[{\"head\":123, \"body\":124, \"leg\":125, \"bag\":-1}]', 'Thẻ ninja tím', 'Ninja với nhiều tài năng để trở thành sát thủ, nhưng kỹ thuật ẩn thân lại không có, nên không thể trở thành sát thủ', '[{\"id\": 94, \"param\": 5, \"activeCard\": 0},\r\n{\"id\": 77, \"param\": 5, \"activeCard\": 1},\r\n{\"id\": 103, \"param\": 5, \"activeCard\": 2}]', -1);
INSERT INTO `radar` VALUES (842, 7479, 4, 40, 1, 1, '[{\"head\":135, \"body\":136, \"leg\":137, \"bag\":-1}]', 'Thẻ trung úy xanh lơ', 'Có siêu năng lực thôi miên nhưng cực kỳ sợ chuột', '[{\"id\": 94, \"param\": 5, \"activeCard\": 0},\r\n{\"id\": 77, \"param\": 5, \"activeCard\": 1},\r\n{\"id\": 103, \"param\": 5, \"activeCard\": 2}]', -1);
INSERT INTO `radar` VALUES (859, 1568, 4, 40, 1, 1, '[{\"head\":144, \"body\":145, \"leg\":146, \"bag\":-1}]', 'Thẻ Độc Nhãn', 'Đầu não của Red Ribbon. Bị chột một mắt, Lúc nhỏ bị mọi người chê là \'thằng lùn\'', '[{\"id\": 94, \"param\": 5, \"activeCard\": 0},\r\n{\"id\": 77, \"param\": 5, \"activeCard\": 1},\r\n{\"id\": 103, \"param\": 5, \"activeCard\": 2}]', -1);
INSERT INTO `radar` VALUES (956, 8935, 4, 50, 1, 1, '[{\"head\":994, \"body\":995, \"leg\":996, \"bag\":-1}]', 'Thẻ Đội Trưởng Vàng', 'Đội trưởng vàng là 1 con hổ hình người chắc nịch cơ thể được bao phủ bởi bộ lông vàng, Goku đã đấm hắn ra khỏi máy bay của mình khi đang bay ở giữa không trung.', '[{\"id\": 94, \"param\": 5, \"activeCard\": 0},\r\n{\"id\": 77, \"param\": 5, \"activeCard\": 1},\r\n{\"id\": 103, \"param\": 5, \"activeCard\": 2}]', 0);
INSERT INTO `radar` VALUES (1142, 11048, 4, 75, 1, 1, '[{\"head\":1236, \"body\":1237, \"leg\":1238, \"bag\":-1}]', 'Thẻ Rồng Thần Namec', 'Rồng thần của Namếc do trưởng lão hành tinh này tạo ra. Khác với rồng thiêng của trái đất, Rồng thần Namếc có thân hình màu xanh to lớn, đồ sộ và đáng sợ hơn. Có thể thực hiện 3 điều ước.', '[{\"id\": 14, \"param\": 10, \"activeCard\": 0},\n{\"id\": 49, \"param\": 10, \"activeCard\": 1},\n{\"id\": 49, \"param\": 20, \"activeCard\": 2}]', 1);
